import React from 'react';
import { BrowserRouter, Switch, Route, NavLink } from 'react-router-dom';
import Login from './components/login/Login';


function App() {
  return (
    <div className="App">
      <BrowserRouter>
          <div className="content">
            <Switch>
              <Route exact path="/" Component={Login} />

            </Switch>
          </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
